Nemato prasmės boikotuoti Rusijos sportininkai Pjongčange varžysis po olimpine vėliava, o jiems laimėjus skambės olimpinis himnas. Olimpiniais kelialapiais galės pasinaudoti tik specialius asmeninius kvietimus gavę rusai. Tokį sprendimą „bendru sutarimu“ priėmė IOC vykdomasis komitetas, antradienį posėdžiavęs Lozanoje (Šveicarija). Formaliai suspenduotas buvo Rusijos olimpinis komitetas, bet atskiriems sportininkams bus leidžiama dalyvauti Pjongčango žaidynėse. Jie turės įveikti ne tik įprastą atranką, bet ir specialios komisijos patikrą, negalės būti praeityje teisti dėl dopingo. Sportininkai negalės vilkėti nacionalinių spalvų aprangos, jų pelnyti medaliai nebus priskiriami Rusijai valstybių įskaitoje, atidarymo ceremonijoje nebus nešama Rusijos vėliava, Rusijos oficialūs asmenys negalės būti akredituoti žaidynėse. Rusija tapo pirmąja dėl dopingo vartojimo formaliai iš olimpinių žaidynių pašalinta valstybe. IOC sprendimas nėra netikėtas. Komentuodamas jį, Th. Bachas teigė, kad Rusija sankcijų susilaukė dėl manipuliavimo dopingo mėginiais, ypač – per 2014 metų Sočio žiemos olimpines žaidynes. Dopingo kontrolės pažeidimus Sočyje jis pavadino „beprecedente ataka prieš sporto integralumą“ . „Labiausiai gaila švarių atletų iš visų šalių, kurie kentėjo dėl šių manipuliacijų. Medaliai tikriesiems savininkams bus įteikti per pagerbimo ceremonijas Pjongčange“, – sakė vokietis. Pristatęs IOC verdiktą, Th. Bachas iškart susilaukė klausimų apie tikimybę, kad įpykusi Rusija nuspręs boikotuoti olimpiadą. „Olimpinis boikotas niekad nepasiekė tikslo, be to, nematau jokio tikslo tai daryti. Juk švariems Rusijos sportininkams mes nekliudysime varžytis žaidynėse“, – replikavo IOC prezidentas. Th. Bachas taip pat kratėsi politinių suspendavimo poteksčių ir teigė neaptaręs galimo sprendimo su Rusijos prezidentu Vladimiru Putinu. „Politiniai pasaulio lyderiai, kaip ir mūsų komerciniai rėmėjai, turbūt supranta, kad IOC yra apolitiška organizacija, kurios neutralumas negali būti niekaip paveiktas“, – kalbėjo Th. Bachas. Ledo ritulininkams jau žiebiama žalia šviesa Dėl atskirų Rusijos atletų dalyvavimo Pjongčange spręs IOC ir dopingo kontrolierių atstovų komisija, kuriai pirmininkaus buvusi Prancūzijos tinklininkė, sporto medicinos specialistė ir politikė Valerie Fourneyron. Komisija analizuos kiekvieno sportininko atvejį ir priims sprendimą, ar jį galima laikyti „švariu“. Kol kas nežinoma, kaip griežtai testų rezultatų istoriją vertins ši darbo grupė, tad neaišku, kiek rusų galima tikėtis Pjongčange. Kvietimus gavę sportininkai oficialiai bus laikomi „olimpiniais atletais iš Rusijos“. Jau pranešama, kad žalia šviesa turėtų būti uždegta Rusijos ledo ritulio ir kerlingo komandoms. Panašiai tikrinami bus ir Rusijos treneriai, medikai bei kitas personalas. Durys užtrenktos ir šalies sporto „grietinėlei“. Rusijos olimpinio komiteto prezidentas Aleksandras Žukovas suspenduotas kaip IOC narys, o buvęs Rusijos sporto ministras Vitalijus Mutko ir jo pavaduotojas Jurijus Nagornychas „ištremti“ iš olimpinių žaidynių iki gyvos galvos. Įdomu, jog V. Mutko tebėra Rusijos futbolo sąjungos prezidentas ir toliau vadovauja kitais metais šioje šalyje vyksiančio planetos futbolo čempionato organizaciniam komitetui. FIFA nelaiko dopingo skandalų Rusijoje didele problema. Th. Bachas buvo paklaustas, ar priimtų V. Mutko kvietimą atvykti į Rusiją ir stebėti pasaulio pirmenybes. „Neatsakysiu į hipotetinius klausimus. Neturiu kvietimo, kai jį gausiu, tuomet spręsiu. Bet IOC vykdomasis komitetas suformavo labai aiškią poziciją V. Mutko atžvilgiu“, – sakė IOC „galva“. Rusijos olimpiniam komitetui taip pat skirta 15 mln. JAV dolerių bauda. Šiuos pinigus žadama panaudoti globalios dopingo kontrolės sistemos stiprinimui. IOC taip pat pasiliko galimybę „iš dalies arba visiškai atšaukti skirtas sankcijas prieš Pjongčango žaidynių uždarymo ceremoniją, jei Rusija priims bausmę ir laikysis jos sąlygų“. Tai reikštų, kad Rusijos vėliava Pietų Korėjoje vis tik gali pasirodyti bent simboliškai. Prieš metus nebuvo tokie ryžtingi Didžiausias istorijoje dopingas skandalas suliepsnojo 2015 metais, kuomet Pasaulinė antidopingo agentūra ( WADA ) pradėjo veiksmus prieš Rusiją, kurią kaltino masinio draudžiamų medžiagų vartojimo sistemos kūrimu ir skatinimu valstybiniu lygmeniu. Pernai prieš Rio de Žaneiro vasaros olimpines žaidynes reikalavimai diskvalifikuoti visą Rusijos olimpinę rinktinę pasiekė apogėjų, kuomet WADA tyrėjas, teisininkas iš Kanados Richardas McLarenas paskelbė ataskaitą, kurioje tvirtinta, kad į susitepusių sportininkų dangstymą buvo įsipainiojusi net Federalinė saugumo tarnyba ( FSB ) ir tuometis sporto ministras, dabartinis vicepremjeras  Vitalijus Mutko . Vis dėlto IOC tuomet nesiryžo vienu ypu pašalinti iš žaidynių Rusijos sportininkų ir pasirinko kompromisą – sprendimo teisę perdavė tarptautinėms federacijoms, kurios dopingo skandalą įvertino skirtingai. Vienintelė Tarptautinė lengvosios atletikos federacija diskvalifikavo visą Rusijos komandą, išskyrus užsienyje gyvenančią šuolininkę į tolį Dariją Klišiną. Kitos federacijos buvo gerokai atlaidesnės, kai kuriems rusams padėjo Tarptautiniam sporto arbitražo teismui (CAS) pateiktos apeliacijos, bet durys į Rio de Žaneirą vis tiek užsitrenkė 112 Rusijos sportininkų. Šiemet dar daugiau tamsių debesų į Rusijos padangę atpūtė pakartotiniai 2008, 2012 ir 2014 metų žaidynėse paimtų dopingo mėginių tyrimai, dėl kurių rusai jau neteko net 38 medalių bei Sočio olimpiados nugalėtojos pozicijos valstybių įskaitoje. Įtariama, kad 2014 metų Sočio žiemos olimpinėse žaidynėse šeimininkės Rusijos specialiųjų tarnybų agentai ciniškai klastojo tautiečių dopingo mėginius. Praėjusį spalį Vilniuje viešėjęs Th. Bachas, DELFI paklaustas apie Sočio olimpiados pamokas, pripažino, jog IOC apsiriko pasitikėdamas Rusija. „Nepaprastai svarbu ateityje užtikrinti dopingo kontrolės žaidynėse kokybę. Negalima visko patikėti olimpiados šeimininkams, būtinas ir tarptautinių ekspertų įtraukimas. Deja, Sočio atveju tai nuo manipuliacijų neapsaugojo. Vadinasi, reikia griežtesnių procedūrų. Reikia stiprinti priežiūros sistemą, griežtinti įsipareigojimus. Tai jau vyksta“, – tuomet sakė IOC prezidentas. Rusijos vadovai ir atsakingi pareigūnai kaltinimus nuolat neigė ir kaltino Vakarų šalis susimokius prieš Maskvą. (function(d, s, i, r) {
